import React from "react";

export default function Card({
  strDrink,
  strAlcoholic,
  strDrinkThumb,
  strIBA,
}) {
  return (
    <div class="row">
      <div class="col s4 m7">
        <div class="card" key={strDrink}>
          <div class="card-image">
            <img src={strDrinkThumb} className="circle responsive-img" />{" "}
            <span class="card-title">{strDrink}</span>
          </div>
          <div class="card-content">
            <p>{strIBA}</p>
            <p>{strAlcoholic}</p>
          </div>
          <div class="card-action">
            <a className="waves-effect waves-light btn">Add to Favourites</a>
          </div>
        </div>
      </div>
    </div>
  );
}
